// HelloWebsocket.jsx
import React, { useEffect, useState } from 'react';
import { connectWebSocket, disconnectWebSocket, sendUpdateTaskMessage } from '../websocket';

const HelloWebsocket = () => {
    const [response, setResponse] = useState(null);

    useEffect(() => {
        connectWebSocket((message) => {
            console.log('Message received from server:', message);
            setResponse(message);
        });

        return () => disconnectWebSocket();
    }, []);

    const handleSendMessage = () => {
        const taskDTO = {
            taskId: '1',
            userId: '1',
            text: 'Updated Task Text',
            completed: false,
            deadlineDate: null,
            planDate: null,
            categoryId: 1
        };
        sendUpdateTaskMessage('1', taskDTO);
    };

    return (
        <div>
            <button onClick={handleSendMessage}>Send Update Task Message</button>
            {response && (
                <div>
                    <h2>Response from server:</h2>
                    <pre>{JSON.stringify(response, null, 2)}</pre>
                </div>
            )}
        </div>
    );
};

export default HelloWebsocket;
